import { useEffect, useState } from "react";
import axios from "axios";
import { useParams } from "react-router-dom";

export default function DogDetail() {
  const [dog, setDog] = useState(null);
  const { id } = useParams();
  useEffect(() => {
    axios(`http://localhost:3001/api/dogs/${id}`).then((res) =>
      setDog(res.data)
    );
  }, []);

  return (
    <div>
      {dog ? (
        <>
          <h3>{dog[0].name}</h3>
          <img src={dog[0].image} alt="Imagen" />
          <div>
            Height:{<br />} {dog[0].height}
          </div>
          <br />
          <div>
            Weight:{<br />} {dog[0].weight}
          </div>
          <br />
          <div>
            Years:{<br />} {dog[0].years}
          </div>
          <br />
          <div>
            Temeperament:{<br />} {dog[0].temperament}
          </div>
        </>
      ) : (
        <div>Loading...</div>
      )}
    </div>
  );
}
